        });
        const tex3 = new THREE.TextureLoader().load('https://mintdes.github.io/gpumesh/LP_Firefox_1001_Roughness.png', t => {
            t.anisotropy = 8;
        });
        const mat = new THREE.MeshStandardMaterial({
            map: tex, // map กับตัวแปร tex ซึ่งเป็นภาพ นำมาแสดงผล
            metalnessMap: tex2, // แผนที่ความเป็นโลหะ
            roughnessMap: tex3, // แผนที่ความขรุขระ
            metalness: 1.0, // ค่าพื้นฐาน จะถูกคูณด้วยแผนที่
            roughness: 1.0
        });

        // 3) ใส่เพิ่มในฉาก
        const mesh = new THREE.Mesh(geom, mat);
        mesh.castShadow = true;
        mesh.receiveShadow = true;
        scene.add(mesh);

        const ground = new THREE.Mesh(
            new THREE.PlaneGeometry(50, 50),
            new THREE.MeshStandardMaterial({ color: 0x808080, roughness: 0.9, metalness: 0.0 })
        );
        ground.rotation.x = -Math.PI / 2;
        ground.position.y = 0;
        ground.receiveShadow = true;
        scene.add(ground);

        const buildingMat = new THREE.MeshStandardMaterial({ color: 0xff5555, roughness: 0.4, metalness: 0.1 });
        const building = new THREE.Mesh(new THREE.BoxGeometry(2, 17, 3), buildingMat);
        building.position.set(7, 1.5, 0);
        building.castShadow = true;
        building.receiveShadow = true;
        scene.add(building);

        

        const envMap = new THREE.RGBELoader()
        .setDataType(THREE.UnsignedByteType) // ใช้ข้อมูลแบบ UnsignedByte
        .load('https://mintdes.github.io/gpumesh/quadrangle_sunny_2k.hdr', function(texture) {
            texture.mapping = THREE.EquirectangularReflectionMapping;
            scene.background = texture
            scene.environment = texture;
        });

        // ✅ render loop
        function animate(t) {

            renderer.render(scene, camera);
            requestAnimationFrame(animate);
        }
        animate(0);

        window.addEventListener('keydown', (event) => {

        });

    </script>
</body>

</html>
